        \       <div style=\"width: 100%;\">\n<div class=\"homeTitle\">\n<div style=\"padding-left:
        10px;\">Applications Online</div>\n</div>\n<br />\n<p>\nWelcome to the City
        of Gosnells online application tracking and lodgement service.\n<br />\n<br
        />\nThe tracking service aims to provide residents, applicants and contractors
        with up to date information on the progress of planning and building applications
        within the City.\nThe lodgement service is for registered users to submit
        building and planning applications electronically.<br />\n<br />\nThe information
        and plans provided with this application may be made available by the City
        of Gosnells for public viewing in connection with the application.<br />\n<br
        />\nPlease read and agree to the terms and conditions below to access the
        site. If you have any questions, please <a target=\"_blank\" href=\"http://www.whitepages.com.au/government-listing/gosnells-city-of-1813020\">contact
        us</a>.</p>\n</div>\n<div style=\"width: 95%; height: 400px; overflow: auto;
        border: 1px solid #dddddd; padding: 3px;\">\n<h2>Terms and Conditions</h2>\nYour
        use of the Planning &amp; Building Application Enquiry and Submission Service
        (\"the Service\") is subject to and conditional upon your acceptance of these
        Terms of Use:\n<br />\n<br />\n<h2>1. Users must not rely on Accuracy of information</h2>\nWhilst
        the City endeavours to update information within the TRACK application (\"application\")
        on a regular basis, the information is provided as a general guide only and
        may be subject to change or may contain errors. The City does not guarantee
        the accuracy of information obtained from the application. You should therefore
        not rely on the accuracy of any information obtained from the application
        without verifying the accuracy of that information from external sources.
        Accurate information in relation to approvals issued by the City may be obtained
        at the City of Gosnells' offices. Accurate lot information can be obtained
        from the Western Australian Land Information Authority (Landgate).\n<br />\n<br
        />\n<h2>2. Changes to Agreement and Service</h2>\nCouncil may vary the Terms
        of Use (Terms) at any time by posting the varied Terms on its website  (\"the
        Site\"). The varied Terms will take effect immediately after any variation
        is posted on the Site. The version of the Terms currently on the Site at any
        time governs your use of the Service. If you continue to use the Service,
        your continued use will constitute acceptance of the Terms and any variations
        to it. Council reserves the right to change any aspect of the Service, including
        modifying, suspending, replacing or terminating the Service as well as imposing
        any fee for access to the Service. Council will have no liability to you if
        the Service is modified, suspended, replaced or terminated. You agree to waive
        all rights you may have against Council in respect of any such action taken
        by Council.\n<br />\n<br />\n<h2>3. Indemnity</h2>\nIt is a condition of use
        that you indemnify the City of Gosnells against claims for any loss or damage
        resulting from your use of any information obtained from the application,
        regardless of whether the loss or damage is caused by inaccuracy of the information,
        the negligence of the City of Gosnells or by any other means.\n<br />\n<br
        />\n<h2>4. Approval records</h2>\nThe Service does not provide a property
        history and should not be relied upon as a record of planning or building
        approvals. Copies of approved plans should be obtained from the City to confirm
        approvals.\n<br />\n<br />\n<h2>5. Use of Information</h2>\nBy accepting these
        terms and conditions, you agree that the information you obtain  from the
        website will not be used for commercial purposes. The website is only to be
        used for submitting and tracking the progress of applications.  The City will
        not be held responsible for any such use by an external party.\n<br />\n<br
        />\n<h2>6. Your Information</h2>\nYour information includes any information,
        including personal information you provide in relation to the Service. You
        agree that all information you provide is complete, accurate and current,
        and that you will take all steps necessary to maintain completeness, accuracy
        and currency of your information at all times including amending your information
        as soon as practicable after it changes.\n<br />\n<br />\nThe information
        and plans provided with this application may be made available by the City
        of Gosnells for public viewing in connection with the application.\n<br />\n<br
        />\n<h2>7. Commencement of use</h2>\nAll information provided is current for
        all application submitted after 1 January 2013.\n<br />\n<br />\n</div>\n</div>\r\n
